import { useState } from 'react';
import Box from '@material-ui/core/Box';
import SwipeableDrawer from '@material-ui/core/SwipeableDrawer';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemText from '@material-ui/core/ListItemText';
import Divider from '@material-ui/core/Divider';
import IconButton from '@material-ui/core/IconButton';
import MenuIcon from '@material-ui/icons/Menu';
import { makeStyles } from '@material-ui/core/styles';
// import { useRouter } from 'next/router';
import AppBar from "@mui/material/AppBar";
import Toolbar from "@mui/material/Toolbar";
import RUhorizontal from "../assets/ipo_horizontal.png";

const useStyles = makeStyles((theme) => ({
  appBar: {
    backgroundColor: "#cc0033 !important",
    color: "white",
  },
  RUhorizontal: {
    width: "50vw",
    padding: "8px",
  },
  menuIcon: {
    marginLeft: "20px",
    "&:hover": {
      backgroundColor: "transparent" 
  }
  },
  list: {
    width: 250,
  },
}));


export default function Drawer() {
  const classes = useStyles();
  // const router = useRouter();
  const [isOpen, setIsOpen] = useState(false);
  return (
    <div>
<AppBar className={classes.appBar} position="static">
      <Toolbar disableGutters>
        <IconButton onClick={() => setIsOpen(!isOpen)} edge="start" color="inherit" aria-label="menu" sx={{ mr: 2 }}>
          <MenuIcon className={classes.menuIcon} />
        </IconButton>
        <img
          src={RUhorizontal}
          className={classes.RUhorizontal}
          alt="RUhorizontal" />
      </Toolbar>
    </AppBar>
      <SwipeableDrawer
        onEscapeKeyDown={isOpen}
        onBackdropClick={isOpen}
        anchor="left"
        open={isOpen}
        onClose={() => isOpen(false)}
        onOpen={() => {}}
      >
        <div className={classes.list}>
          <Box textAlign="center" p={2}>
            Components
          </Box>
          <Divider />
          <List>
            {/* <ListItem button onClick={() => router.push('/container')}>
              <ListItemText primary={'Container'} />
            </ListItem>
            <ListItem button onClick={() => router.push('/grid')}>
              <ListItemText primary={'Grid'} />
            </ListItem>
            <ListItem button onClick={() => router.push('/box')}>
              <ListItemText primary={'Box'} />
            </ListItem>
            <ListItem button onClick={() => router.push('/cards')}>
              <ListItemText primary={'Cards'} />
            </ListItem> */}
          </List>
        </div>
      </SwipeableDrawer>
    </div>
  );
}
